import React from "react";
import Book from "./Book";

const List = (props) => {
    if (props.items.length === 0){
        return <h2>Found no books.</h2>
    }

    return(
        <ul>
            {props.items.map((book) => (
                <Book
                key={book.id}
                title={book.title}
                author={book.title}
                title={book.title}/>  
            ))}
        </ul>
    );
}

export default List;
